    def armMag(self, b):
        if b.isChecked() == True:
            self.Ramp.setEnabled(False)
            self.Mag.setEnabled(False)
            self.RampDown.setEnabled(True)
            self.RampUp.setEnabled(True)
            self.Zero.setEnabled(True)
        else:
            self.Ramp.setEnabled(True)
            self.Mag.setEnabled(True)
            self.RampDown.setEnabled(False)
            self.RampUp.setEnabled(False)
            self.Zero.setEnabled(False)

    def rampApply(self):
        self.ApplyRamp.setChecked(True)

    def changeRamp(self):
        self.ApplyRamp.setChecked(False)